    "privacyPolicy" : MessageLookupByLibrary.simpleMessage("Πολιτική Απορρήτου"),
    "privacyTerms" : MessageLookupByLibrary.simpleMessage("Σύμφωνα με τη βιετναμέζικη νομοθεσία, οι πληροφορίες των χρηστών όπως ονόματα, διευθύνσεις ηλεκτρονικού ταχυδρομείου, κωδικοί πρόσβασης και ημερομηνία γέννησης θα μπορούσαν να ταξινομηθούν ως «προσωπικά στοιχεία.\n\n Συγκεκριμένα,\n (α) Σύμφωνα με το διάταγμα 72/2013, τα προσωπικά στοιχεία ορίζονται ως πληροφορίες που επισυνάπτονται στην ταυτοποίηση της ταυτότητας και των προσωπικών στοιχείων ενός ατόμου, συμπεριλαμβανομένου του ονόματος, της ηλικίας, της διεύθυνσης, του αριθμού ταυτότητας των ατόμων, του αριθμού τηλεφώνου, της διεύθυνσης email και άλλων πληροφοριών όπως ορίζεται από το νόμο\n\n (β) Σύμφωνα με την Εγκύκλιο 25/2010, τα προσωπικά στοιχεία σημαίνουν πληροφορίες επαρκείς για την ακριβή αναγνώριση ενός ατόμου, το οποίο περιλαμβάνει τουλάχιστον μία από τις ακόλουθες λεπτομέρειες: πλήρες όνομα, ημερομηνία γέννησης, επάγγελμα, τίτλος, διεύθυνση επικοινωνίας, διεύθυνση email, αριθμός τηλεφώνου, ταυτότητα αριθμός κάρτας και αριθμός διαβατηρίου. Οι πληροφορίες σχετικά με το προσωπικό απόρρητο περιλαμβάνουν το αρχείο υγείας, το αρχείο πληρωμής φόρου, τον αριθμό κάρτας κοινωνικής ασφάλισης, τον αριθμό πιστωτικής κάρτας και άλλα προσωπικά μυστικά.\n\n Η εγκύκλιος 25 ισχύει για τη συλλογή και χρήση προσωπικών πληροφοριών από ιστότοπους που διαχειρίζονται οι κυβερνητικές αρχές του Βιετνάμ. Η εγκύκλιος 25 δεν ισχύει άμεσα για τη συλλογή και χρήση προσωπικών πληροφοριών από ιστότοπους που διαχειρίζονται μη κυβερνητικές οντότητες. Ωστόσο, οι διατάξεις της εγκυκλίου 25 θα μπορούσαν να εφαρμοστούν κατ \'αναλογία. Επιπλέον, είναι πιθανό μια μη κυβερνητική οντότητα να υπόκειται στα ίδια ή αυστηρότερα πρότυπα από αυτά που ισχύουν για μια κυβερνητική οντότητα."),
